import './App.css';
import { NeuCard, NeuHeading, NeuProgressBar, NeuReaction } from 'neumorphic-ui';

function App() {
  return (
    <div>
      <p>Hello World</p>
      <NeuHeading text="NOME" />

      <NeuReaction size="300px" ></NeuReaction>

    </div>
  );
}

export default App;
